import React from 'react';
import './App.css';
import LeftPanel from './components/leftPanel';
import RightPanel from './components/rightPanel';



export default class App extends React.Component {

    constructor(props) {
    super(props);
    this.state = {
      user: this.getUser()
      }
    }


  getUser(){
    //var url=queryString.parse(window.location.href.search);
    //var user = qs.parse(window.location.href.search, { ignoreQueryPrefix: true }).user;
   var user = new URLSearchParams(window.location.href.search).get("user");
    alert(user);
    return user;
  }

  render(){
    return (

      <div className="App">
        <header className = "App-header">
          <div>Your Youtube Library</div>
        </header>

      <LeftPanel className= "leftPanel"/>

      <RightPanel className = "rightPanel"/>

      <div className= "clearfix"></div>

      </div>

    );
  }

}
